import React from 'react';
import IdComponent from './components/IdComponent';
import NameComponent from './components/NameComponent';
import SizeComponent from './components/SizeComponent';
import PriceComponent from './components/PriceComponent';
import ImagesComponent from './components/ImagesComponent';
import './styles/App.css';

const App = () => {
    const watchData = {
        id: '12345',
        name: 'Stylish Watch',
        size: '42mm',
        price: '$199.99',
        images: [
            'image1.jpg',
            'image2.jpg',
            'image3.jpg'
        ]
    };

    return (
        <div className="container">
            <h1>Watch Details</h1>
            <div className="grid-container">
                <div className="grid-item">
                    <IdComponent id={watchData.id} />
                </div>
                <div className="grid-item">
                    <NameComponent name={watchData.name} />
                </div>
                <div className="grid-item">
                    <SizeComponent size={watchData.size} />
                </div>
                <div className="grid-item">
                    <PriceComponent price={watchData.price} />
                </div>
                <div className="grid-item">
                    <ImagesComponent images={watchData.images} />
                </div>
            </div>
        </div>
    );
};

export default App;
